import { NgModule } from "@angular/core";
import { RouterModule, Routes } from "@angular/router";
import { AppMainComponentComponent } from "../modules/page-layout/components/app-main-component/app-main-component.component";
import { MainPageComponent } from "../modules/main-page/components/main-page/main-page.component";

const routes: Routes = [
  {
    path: "",
    component: AppMainComponentComponent,
    children: [
      {
        path: "",
        pathMatch: "full",
        component: MainPageComponent,
      },
    ],
  },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}
